            $_CODFORNECEDOR = $retornoItem["CODIGO_FORNECEDOR"];
        }else{
            $consultaItem = $pdo->query("SELECT CODIGO_FORNECEDOR FROM bd_novo.itemestoque WHERE Codigo_Barra = '$Codigo_Barra' and Codigo_Barra <> '' limit 1");
